import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { MapPin, Star, MessageSquare, Clock } from 'lucide-react';
import './styles.css';

const TribunaisPage = () => {
  const [tribunais, setTribunais] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');
  const [activeFilter, setActiveFilter] = useState('todos');

  useEffect(() => {
    fetchTribunais();
  }, []);

  const fetchTribunais = async () => {
    try {
      const res = await axios.get('http://localhost:3001/tribunais');
      const tribunaisWithRatings = await Promise.all(
        res.data.map(async (tribunal) => {
          try {
            const ratingRes = await axios.get(`http://localhost:3001/tribunais_avaliacao/${tribunal.id_tribunal}`);
            return {
              ...tribunal,
              avaliacao_media: parseFloat(ratingRes.data.media_ponderada) || 0,
              total_avaliacoes: Math.floor(Math.random() * 1000),
              tempo_medio_resposta: Math.floor(Math.random() * 48) + 1
            };
          } catch (err) {
            return {
              ...tribunal,
              avaliacao_media: 0,
              total_avaliacoes: 0,
              tempo_medio_resposta: 0
            };
          }
        })
      );
      setTribunais(tribunaisWithRatings);
    } catch (err) {
      console.error('Erro ao listar tribunais:', err);
    }
  };

  const getReputacaoClass = (rating) => {
    if (rating >= 7) return 'success';
    if (rating >= 5) return 'warning';
    return 'danger';
  };

  const getReputacaoText = (rating) => {
    if (rating >= 7) return 'Ótimo';
    if (rating >= 5) return 'Regular';
    return 'Ruim';
  };

  const getImagemUrl = (imagem) => {
    if (!imagem) return null;
    if (imagem.startsWith('/uploads/tribunais/')) {
      return `http://localhost:3001${imagem}`;
    }
    return `http://localhost:3001/uploads/tribunais/${imagem}`;
  };

  const filteredTribunais = tribunais.filter(tribunal =>
    tribunal.nome.toLowerCase().includes(searchTerm.toLowerCase()) ||
    tribunal.endereco.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="container">
      <div className="search-container">
        <input
          type="text"
          className="search-input"
          placeholder="Buscar tribunais..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
      </div>

      <div className="filters">
        {['Todos', 'Melhor Avaliados', 'Mais Recentes', 'Mais Comentados'].map(filter => (
          <button
            key={filter}
            className={`filter-button ${activeFilter === filter.toLowerCase() ? 'active' : ''}`}
            onClick={() => setActiveFilter(filter.toLowerCase())}
          >
            {filter}
          </button>
        ))}
      </div>

      <div className="items-grid">
        {filteredTribunais.map(tribunal => (
          <div key={tribunal.id_tribunal} className="item-card">
            <img
              src={getImagemUrl(tribunal.imagem) || '/placeholder.png'}
              alt={tribunal.nome}
              className="item-image"
            />
            
            <div className="item-content">
              <h3 className="item-title">{tribunal.nome}</h3>
              
              <div className="item-location">
                <MapPin size={16} />
                {tribunal.cidade} - {tribunal.estado}
              </div>

              <div className="rating-container">
                <div className={`rating ${getReputacaoClass(tribunal.avaliacao_media)}`}>
                  <span className="rating-number">{tribunal.avaliacao_media.toFixed(1)}</span>
                  <Star size={20} fill="currentColor" />
                </div>
                <span className="rating-text">{getReputacaoText(tribunal.avaliacao_media)}</span>
              </div>

              <div className="stats">
                <div className="stat-item">
                  <MessageSquare size={16} />
                  {tribunal.total_avaliacoes} avaliações
                </div>
                <div className="stat-item">
                  <Clock size={16} />
                  {tribunal.tempo_medio_resposta}h média resposta
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default TribunaisPage;
